import React, { useState, useRef, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import Landing from "./pages/Landing";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Navbar from './Components/Navbar';
import Home from "./pages/Home";
import ProtectedRoute from "./Components/ProtectedRoute";
import About from "./pages/About";
import Terms from "./pages/Terms";
import Contact from "./pages/Contact";
import "./App.css";
function AppContent() {
  const [showDropdown, setShowDropdown] = useState(false);
  const [darkMode, setDarkMode] = useState(false);
  const dropdownRef = useRef(null);
  const navigate = useNavigate();
  const toggleDropdown = () => setShowDropdown(prev => !prev);
  const toggleDarkMode = () => setDarkMode(prev => !prev);
  useEffect(() => {
    const closeDropdown = (e) => {
      if (dropdownRef.current && !dropdownRef.current.contains(e.target)) {
        setShowDropdown(false);
      }
    };
    document.addEventListener("mousedown", closeDropdown);
    return () => document.removeEventListener("mousedown", closeDropdown);
  }, []);
  const handleNav = (path) => {
    navigate(path);
    setShowDropdown(false);
  };
  return (
    <div className={`app-container ${darkMode ? 'dark' : ''}`}>
      <Navbar />
      <div className="banner">
        <div className="menu-actions">
          <button className="menu-button" onClick={toggleDropdown}>☰ Menu</button>
          <button className="toggle-theme" onClick={toggleDarkMode}>
            {darkMode ? ':sun_with_face:' : ':crescent_moon:'}
          </button>
        </div>
        {showDropdown && (
          <div className="dropdown-list" ref={dropdownRef}>
            <ul className="dropdown-menu-list">
              <li onClick={() => handleNav("/home")}>:house: Home</li>
              <li onClick={() => handleNav("/about")}>:information_source: About Us</li>
              <li onClick={() => handleNav("/terms")}>:page_facing_up: Terms & Conditions</li>
              <li onClick={() => handleNav("/contact")}>:email: Contact Us</li>
            </ul>
          </div>
        )}
        <h1>Welcome to 7StarInterior App</h1>
      </div>
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/about" element={<About />} />
        <Route path="/terms" element={<Terms />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/home" element={<ProtectedRoute><Home /></ProtectedRoute>} />
      </Routes>
      <footer>
        <p>© 7StarInterior App. All rights reserved.</p>
      </footer>
    </div>
  );
}
export default function App() {
  return (
    <Router>
      <AppContent />
    </Router>
  );
}
